description:
Oftly Goldwin is proud to present Andre Cowboy! And this is a western story featuring a lone cowboy who is on a quest to find some of the hottest and spiciest women out there on the lonely plains! Andre the cowboy has a six-shooter in his holster and babes like Cinthia Santos, Kelly Amaral and Leticia Blond want to unleash it for their own personal pleasures! Giddy up and get down on it!

